  lic = () => {

   ReactDOM.render(<Global />, document.getElementById('root'));
   alert(22);
  }

  render() {

    return (
     <div>

      <p>cbiuwbiucw</p>
      <button onClick={this.lic} id="lic_button">click me</button>
     </div>
    );
  }

}

export default Home;
